"use strict";(self.webpackChunkmydatahack_blog_site=self.webpackChunkmydatahack_blog_site||[]).push([[9924],{22752:(e,t,a)=>{a.r(t),a.d(t,{assets:()=>d,contentTitle:()=>i,default:()=>u,frontMatter:()=>r,metadata:()=>s,toc:()=>l});var o=a(74848),n=a(28453);const r={sidebar_position:3},i="ETL Developers are Dead",s={id:"Infrastructure/Opinions/etl-dev-is-dead",title:"ETL Developers are Dead",description:"I remember when I was a DataStage developer in circa 2014. All I did was making DataStage jobs. I was working on an enterprise data warehouse. In that company, they were using it for batch integration between systems. So, I also maintained those jobs. It was my first ETL development job and I didn\u2019t know anything better. I was a happy ETL developer. DataStage is pretty intense and you really need to be specialised for the tool. Moving a table from one database to another takes a serious development effort. I remember that I spent days just figuring out the character mismatch or datetime transformation between databases in order to copy a table.",source:"@site/docs/Infrastructure/Opinions/3.etl-dev-is-dead.md",sourceDirName:"Infrastructure/Opinions",slug:"/Infrastructure/Opinions/etl-dev-is-dead",permalink:"/docs/Infrastructure/Opinions/etl-dev-is-dead",draft:!1,unlisted:!1,tags:[],version:"current",sidebarPosition:3,frontMatter:{sidebar_position:3},sidebar:"tutorialSidebar",previous:{title:"The Most Frustrating Thing About Being a Cloud Native Developer",permalink:"/docs/Infrastructure/Opinions/cloud-native-dev-frustration"},next:{title:"Tips to Be a Good Code Reviewer",permalink:"/docs/Infrastructure/Opinions/be-good-code-reviewer"}},d={},l=[];function c(e){const t={h1:"h1",p:"p",...(0,n.R)(),...e.components};return(0,o.jsxs)(o.Fragment,{children:[(0,o.jsx)(t.h1,{id:"etl-developers-are-dead",children:"ETL Developers are Dead"}),"\n",(0,o.jsx)(t.p,{children:"I remember when I was a DataStage developer in circa 2014. All I did was making DataStage jobs. I was working on an enterprise data warehouse. In that company, they were using it for batch integration between systems. So, I also maintained those jobs. It was my first ETL development job and I didn\u2019t know anything better. I was a happy ETL developer. DataStage is pretty intense and you really need to be specialised for the tool. Moving a table from one database to another takes a serious development effort. I remember that I spent days just figuring out the character mismatch or datetime transformation between databases in order to copy a table."}),"\n",(0,o.jsx)(t.p,{children:"Making a data mart with DataStage is even more intense. I needed to learn the tool really well to be effective. Back then, I had a lot of fun playing with it. It was OK for me to just work on DataStage because they just had a traditional data warehouse that crunched data overnight."}),"\n",(0,o.jsx)(t.p,{children:"Although the traditional data warehousing development with an ETL tool is still important, it\u2019s not only job you need to do as a developer in a data team. You are required to do real-time ingestion, API data ingestions, big data and also transforming data for ML or AI applications. It requires more skills than ETL. You cannot afford to be only using ETL. Nowadays, you need to be a data engineer who can use different tools to ingest and transform data in many different ways."}),"\n",(0,o.jsx)(t.p,{children:"Because of the diverse data ingestion and transformation requirements, it is better for a company to choose light-weight tool to do ETL. There are heaps of ETL tools that copies tables with a few clicks. We don\u2019t really need to use a complex and expensive tool like DataStage. We can just use more affordable options. If you are building a data warehouse in a cloud environment, it is worth looking into using the native tool that comes with that environment."}),"\n",(0,o.jsx)(t.p,{children:"We have to say good-by to the good old days of ETL specialists. ETL developers are dead."}),"\n",(0,o.jsx)(t.p,{children:"(2020-10-10)"})]})}function u(e={}){const{wrapper:t}={...(0,n.R)(),...e.components};return t?(0,o.jsx)(t,{...e,children:(0,o.jsx)(c,{...e})}):c(e)}},28453:(e,t,a)=>{a.d(t,{R:()=>i,x:()=>s});var o=a(96540);const n={},r=o.createContext(n);function i(e){const t=o.useContext(r);return o.useMemo((function(){return"function"==typeof e?e(t):{...t,...e}}),[t,e])}function s(e){let t;return t=e.disableParentContext?"function"==typeof e.components?e.components(n):e.components||n:i(e.components),o.createElement(r.Provider,{value:t},e.children)}}}]);